import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

class timer extends React.Component {
  render(){
    return (
    <div className="timer">
      <h1><label className="hh">00</label>
      :
      <label className="mm">30</label>
      :
      <label className="ss">00</label>
      </h1>
      <p>&nbsp;&nbsp;&nbsp;Hour &nbsp;&nbsp;&nbsp;&nbsp; Minute &nbsp;&nbsp;&nbsp;&nbsp; Seconde</p>
    </div>
  );}
}

ReactDOM.render(
  <timer time="2433276000" />,
  document.getElementById("root")
);

export default timer;
